**To Reproduce**

A description of my workflow: I'm creating a single Env for 4 sessions (I have 4 different graphs along it). I have a session data struct that stores the Ort env and session pointers and I call the constructors by `new` command. Bellow is my following code.

```c++
    int intraOpNumThreads = 1;
    int interOpNumThreads = 1;
    
    OrtThreadingOptions *thOpt;
    OrtStatusPtr status;

    status = Ort::GetApi().CreateThreadingOptions(&thOpt);
    status = Ort::GetApi().SetGlobalIntraOpNumThreads(thOpt, intraOpNumThreads);
    status = Ort::GetApi().SetGlobalInterOpNumThreads(thOpt, interOpNumThreads);

    s->env = new Ort::Env(thOpt, ORT_LOGGING_LEVEL_FATAL, "run_env");
    Ort::SessionOptions session_options;

    session_options.SetIntraOpNumThreads(intraOpNumThreads);
    session_options.SetInterOpNumThreads(interOpNumThreads);
    session_options.SetExecutionMode(ORT_SEQUENTIAL);
    session_options.DisablePerSessionThreads();
    session_options.SetGraphOptimizationLevel(GraphOptimizationLevel::ORT_ENABLE_ALL);

    s->net1_session = new Ort::Session(*(s->env), graph1, graph1_size, session_options);
    s->net2_session = new Ort::Session(*(s->env), graph2, graph2_size, session_options);
    s->net3_session = new Ort::Session(*(s->env), graph3, graph3_size, session_options);
    s->net4_session = new Ort::Session(*(s->env), graph4, graph4_size, session_options);
``` 

**Expected behavior**
With the current config I'm getting 11 threads (1 Running 10 Asleep) when I expected a single thread initialized and running.
Anything I'm missing here?

